column2:
What is printed to console.log?

var s = "hello";
console.log(s.split());

What is printed to console.log?

var p = {
    i: 42
};
var o = Object.create(p, {
    i: {
        value: 24
    }
});
console.log(o.i);

What is printed to console.log?

Object.prototype.test = 42;
var o = { i: 84 };
for (var p in o) {
    console.log(p, o[p]);
}

What is printed to console.log?

var o = { i: 84 };
Object.freeze(o);
o.i = 42;
console.log(o.i);

What is printed to console.log?

var o = {i: 42, j: 84, k: 100};
var k = Object.keys(o);
var total = 0;
for (var i = 0; i < k.length; i++) {
    total += o[k[i]];
}
console.log(total);

Which of the answers is equivalent to the following:

var f = function (i) {
    return i;
};

What is printed to console.log?

var Animal = function (name) {
    var speak = () => name || "Bob"
    this.speak = speak;
}
var cat = new Animal("Tom");
console.log(cat.speak());

Which of the answers is equivalent to the following:

class Animal {
    constructor(i) {
        this.i = i;
    }
}

What is printed to console.log?

class Animal {
    constructor(name) {
        this.name = name || "Fido";
    }
    toString() {
        return "My name is: " + this.name;
    }
}
var cat = new Animal();
console.log("" + cat);

What is printed by console.log?

var f = function (x, ...y) {
  console.log(y);
}
f(1, 2, "cat", 3)

What is printed by console.log?

var f = function () {
    const x = 42;
    var a = 24;
    x = 100;
    console.log(a, x);
};

What will be printed by console.log?

var f = function*() {
    for (var i = 0; i < 10; i++) {
        yield i;
    }
};

var a = [];
for (var i of f()) {
    a.push(i);
}
console.log(a);

What is printed to console.log?

var a = "abc";
for (let i of a) {
    console.log(i);
    break;
}

What will be printed to console.log?

var s = new Set();
s.add(42);
s.add("42");
s.add(42);
console.log(s.size);

What will be printed to console.log?

var m = new Map();
m.set(42, "Hello");
m.set("42", "World");
console.log(m.get(42), m.get("42"));

What will be printed to console.log?

var o = {
    i: 42
};
var p = {};
Object.assign(p, o);
console.log(o.i, p.i);

Starting in ECMAScript6, which of the answers is the equivalent of the following?

var f = function (a, b) {
    a = a || 42;
    b = b || 34;
    return a + b;
};

What is printed in console.log?

var s = "Hello";
console.log([...s]);

What is printed in console.log?

var o = {
    i: 42,
    j: 24
};
var { i, j } = o;
console.log(j, i);

What is printed in console.log?

var o = {
    i: 42,
    j: 24
};
var { i: a, j: b } = o;
console.log(b, a);

What is printed to console.log?

var f = function([a, b, c]) {
    return a + b + c + 100;
};
var a = [1, 2, 3];
console.log(f(a));

What is printed to console.log?

var f = function () {
    if (!console) {
        var console = {};
        console.log = function () {
            return 42;
        }
    }
    console.log(100);
};
f();
